"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[9062],{5175:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"gx-grid-v1.10.1","metadata":{"permalink":"/BBjGridExWidget/blog/gx-grid-v1.10.1","editUrl":"https://github.com/BBj-Plugins/BBjGridExWidget/tree/dev/website/blog/2022-08-03-gx-grid-v1.10.1/index.md","source":"@site/blog/2022-08-03-gx-grid-v1.10.1/index.md","title":"BBjGridExWidget v1.10.1","description":"Bug Fixes","date":"2022-08-03T00:00:00.000Z","formattedDate":"August 3, 2022","tags":[{"label":"release","permalink":"/BBjGridExWidget/blog/tags/release"},{"label":"changelog","permalink":"/BBjGridExWidget/blog/tags/changelog"}],"readingTime":0.07,"hasTruncateMarker":false,"authors":[{"name":"Hyyan Abo Fakher","title":"Maintainer","url":"https://github.com/hyyan","imageURL":"https://github.com/hyyan.png","key":"hyyan"}],"frontMatter":{"slug":"gx-grid-v1.10.1","title":"BBjGridExWidget v1.10.1","authors":["hyyan"],"tags":["release","changelog"]},"nextItem":{"title":"BBjGridExWidget v1.10.0","permalink":"/BBjGridExWidget/blog/gx-grid-v1.10.0"}},"content":"## Bug Fixes\\n\\n* **js:** `SuggestionEditor` is broken ([ee1e573](https://github.com/BBj-Plugins/BBjGridExWidget/commit/ee1e573a277305fa8b58b544cc12ecb36285d203))\\n* `GxOptions::setStopEditingWhenGridLosesFocus` is broken ([76edc2a](https://github.com/BBj-Plugins/BBjGridExWidget/commit/76edc2a3cc34ae965645a347d2b79041bfb88765))"},{"id":"gx-grid-v1.10.0","metadata":{"permalink":"/BBjGridExWidget/blog/gx-grid-v1.10.0","editUrl":"https://github.com/BBj-Plugins/BBjGridExWidget/tree/dev/website/blog/2022-07-26-gx-grid-v1.10.0/index.md","source":"@site/blog/2022-07-26-gx-grid-v1.10.0/index.md","title":"BBjGridExWidget v1.10.0","description":"Bug Fixes","date":"2022-07-26T00:00:00.000Z","formattedDate":"July 26, 2022","tags":[{"label":"release","permalink":"/BBjGridExWidget/blog/tags/release"},{"label":"changelog","permalink":"/BBjGridExWidget/blog/tags/changelog"}],"readingTime":0.105,"hasTruncateMarker":false,"authors":[{"name":"Hyyan Abo Fakher","title":"Maintainer","url":"https://github.com/hyyan","imageURL":"https://github.com/hyyan.png","key":"hyyan"}],"frontMatter":{"slug":"gx-grid-v1.10.0","title":"BBjGridExWidget v1.10.0","authors":["hyyan"],"tags":["release","changelog"]},"prevItem":{"title":"BBjGridExWidget v1.10.1","permalink":"/BBjGridExWidget/blog/gx-grid-v1.10.1"},"nextItem":{"title":"BBjGridExWidget v1.9.0","permalink":"/BBjGridExWidget/blog/gx-grid-v1.9.0"}},"content":"## Bug Fixes\\n\\n* restore `GxColumn.DefaultStringsMask`, `GxColumn.DefaultNumbersMask`, `GxColumn.DefaultDatesMask`, `GxColumn.DefaultTimesMask` and `GxColumn.DefaultTimestamps` for backwards compatibility\\n\\n* restore `GxColumn.setColumnMask` method for backwards compatibility."},{"id":"gx-grid-v1.9.0","metadata":{"permalink":"/BBjGridExWidget/blog/gx-grid-v1.9.0","editUrl":"https://github.com/BBj-Plugins/BBjGridExWidget/tree/dev/website/blog/2022-07-25-gx-grid-v1.9.0/index.md","source":"@site/blog/2022-07-25-gx-grid-v1.9.0/index.md","title":"BBjGridExWidget v1.9.0","description":"Bug Fixes","date":"2022-07-25T00:00:00.000Z","formattedDate":"July 25, 2022","tags":[{"label":"release","permalink":"/BBjGridExWidget/blog/tags/release"},{"label":"changelog","permalink":"/BBjGridExWidget/blog/tags/changelog"}],"readingTime":0.585,"hasTruncateMarker":false,"authors":[{"name":"Hyyan Abo Fakher","title":"Maintainer","url":"https://github.com/hyyan","imageURL":"https://github.com/hyyan.png","key":"hyyan"}],"frontMatter":{"slug":"gx-grid-v1.9.0","title":"BBjGridExWidget v1.9.0","authors":["hyyan"],"tags":["release","changelog"]},"prevItem":{"title":"BBjGridExWidget v1.10.0","permalink":"/BBjGridExWidget/blog/gx-grid-v1.10.0"},"nextItem":{"title":"BBjGridExWidget v1.8.0","permalink":"/BBjGridExWidget/blog/gx-grid-v1.8.0"}},"content":"## Bug Fixes\\n\\n* !ERROR=32 (BBj Custom Object Stack Overflow) `getSuppressWebDebouncing()`. ([1350a60](https://github.com/BBj-Plugins/BBjGridExWidget/commit/1350a6098af3e382501c4092960e1bf5fd7bf286))\\n* `GxExecutor` does not check if the grid is destroyed before executing code. ([9b33eab](https://github.com/BBj-Plugins/BBjGridExWidget/commit/9b33eabc2d729897f9e62a28d3bda35b1b98f00c))\\n\\n\\n## Code Refactoring\\n\\n* rename `BBjGridExWidget.suppressBuiDebouncing` to `BBjGridExWidget.suppressWebDebouncing`. ([0252c22](https://github.com/BBj-Plugins/BBjGridExWidget/commit/0252c2277267326b846fb2d9cf986859d7f0f9b8))\\n\\n\\n## Features\\n\\n* add `BBjGridExWidget:preferAsyncExecution`. ([ea432eb](https://github.com/BBj-Plugins/BBjGridExWidget/commit/ea432eba6f0303dd0a5a66097bd48a9cb7e75c89)). When enabled then the executor will try to executes the JavaScript in the\\nBBjHtmlView and returns immediately without waiting for a return value\\nfrom the client. Enabling this option might boost the performance of the grid.\\nBy default this option is turned off\\n\\n* add `GxColumn::setMask` method. ([294a513](https://github.com/BBj-Plugins/BBjGridExWidget/commit/294a513d23b5da4299c52513be356561e31eccbe))\\n\\n\\n## BREAKING CHANGES\\n\\n* `BBjGridExWidget.suppressBuiDebouncing` is deprecated.\\nUse `BBjGridExWidget.suppressWebDebouncing` instead\\n* `DefaultStringsMask`, `DefaultNumbersMask`, `DefaultDatesMask`,`DefaultTimesMask` and `DefaultTimestamps` are deprecated use `Mask` instated.\\n* `setColumnMask` is deprecated use `setMask` instead."},{"id":"gx-grid-v1.8.0","metadata":{"permalink":"/BBjGridExWidget/blog/gx-grid-v1.8.0","editUrl":"https://github.com/BBj-Plugins/BBjGridExWidget/tree/dev/website/blog/2022-07-18-gx-grid-v1.8.0/index.md","source":"@site/blog/2022-07-18-gx-grid-v1.8.0/index.md","title":"BBjGridExWidget v1.8.0","description":"Bug Fixes","date":"2022-07-18T00:00:00.000Z","formattedDate":"July 18, 2022","tags":[{"label":"release","permalink":"/BBjGridExWidget/blog/tags/release"},{"label":"changelog","permalink":"/BBjGridExWidget/blog/tags/changelog"}],"readingTime":0.52,"hasTruncateMarker":false,"authors":[{"name":"Hyyan Abo Fakher","title":"Maintainer","url":"https://github.com/hyyan","imageURL":"https://github.com/hyyan.png","key":"hyyan"}],"frontMatter":{"slug":"gx-grid-v1.8.0","title":"BBjGridExWidget v1.8.0","authors":["hyyan"],"tags":["release","changelog"]},"prevItem":{"title":"BBjGridExWidget v1.9.0","permalink":"/BBjGridExWidget/blog/gx-grid-v1.9.0"},"nextItem":{"title":"BBjGridExWidget v1.7.1","permalink":"/BBjGridExWidget/blog/gx-grid-v1.7.1"}},"content":"## Bug Fixes\\n\\n* dont show `CHART_RANGE` context menu item by default ([5806120](https://github.com/BBj-Plugins/BBjGridExWidget/commit/580612027949004c0eaa215d7fc20536dda33574))\\n* fix typo - `GxFiltersToolpanel::suppressExpandAl` should be `GxFiltersToolpanel::suppressExpandAll` ([50e5c79](https://github.com/BBj-Plugins/BBjGridExWidget/commit/50e5c794ba4eb1ab4ed10edbb09ee1104a8164be))\\n* focus should focus the container if it is empty. ([0817b4b](https://github.com/BBj-Plugins/BBjGridExWidget/commit/0817b4b7a1c333185b3adee38e3a4282128778e4))\\n* remove GxContextMenuItem::EXCEL_XML_EXPORT ([3de3308](https://github.com/BBj-Plugins/BBjGridExWidget/commit/3de33082d39e1cb9475282bcd33b092388b9af59))\\n* **js:** transiation add array should be reversed to be in sync with ResultSet ([64f30d8](https://github.com/BBj-Plugins/BBjGridExWidget/commit/64f30d88e98a7bcd9c1690bf5c1dd9bee6dc05f2))\\n\\n\\n## Features\\n\\n* add GxColumn `SuppressFiltersToolPanel` option ([0cf67b9](https://github.com/BBj-Plugins/BBjGridExWidget/commit/0cf67b93c0e8abd04f70e5cd5765c79648031fba))\\n* add GxColumnsToolpanel `SuppressSyncLayoutWithGrid` & `SuppressColumnMove` and `ContractColumnSelection` options ([9ac3d2b](https://github.com/BBj-Plugins/BBjGridExWidget/commit/9ac3d2b51089592112c8d7bd5b331f990faf89f4))\\n* add GxContextMenuItem `COPY_WITH_GROUP_HEADERS` ([8b639dd](https://github.com/BBj-Plugins/BBjGridExWidget/commit/8b639dd157dcdbc1d8ece3abcefb1f9d9df03e45))\\n* add GxFiltersToolpanel `SuppressExpandAll` option ([8d6bf43](https://github.com/BBj-Plugins/BBjGridExWidget/commit/8d6bf43449a52c9d41e9c46c5f678a50117215ab))\\n* add GxFiltersToolpanel `SuppressFilterSearch` & `SuppressSyncLayoutWithGrid` ([196341d](https://github.com/BBj-Plugins/BBjGridExWidget/commit/196341db88cdc0d9ee7a2940f41bc7aeface62ca))\\n* show context menu `COPY_WITH_GROUP_HEADERS` by default ([c369079](https://github.com/BBj-Plugins/BBjGridExWidget/commit/c369079704fe6e1e30fd696375b4cc717314a733))\\n\\n\\n## BREAKING CHANGES\\n\\n* EXCEL_XML_EXPORT has been removed"},{"id":"gx-grid-v1.7.1","metadata":{"permalink":"/BBjGridExWidget/blog/gx-grid-v1.7.1","editUrl":"https://github.com/BBj-Plugins/BBjGridExWidget/tree/dev/website/blog/2022-07-13-gx-grid-v1.7.1/index.md","source":"@site/blog/2022-07-13-gx-grid-v1.7.1/index.md","title":"BBjGridExWidget v1.7.1","description":"Bug Fixes","date":"2022-07-13T00:00:00.000Z","formattedDate":"July 13, 2022","tags":[{"label":"release","permalink":"/BBjGridExWidget/blog/tags/release"},{"label":"changelog","permalink":"/BBjGridExWidget/blog/tags/changelog"}],"readingTime":0.18,"hasTruncateMarker":false,"authors":[{"name":"Hyyan Abo Fakher","title":"Maintainer","url":"https://github.com/hyyan","imageURL":"https://github.com/hyyan.png","key":"hyyan"}],"frontMatter":{"slug":"gx-grid-v1.7.1","title":"BBjGridExWidget v1.7.1","authors":["hyyan"],"tags":["release","changelog"]},"prevItem":{"title":"BBjGridExWidget v1.8.0","permalink":"/BBjGridExWidget/blog/gx-grid-v1.8.0"},"nextItem":{"title":"BBjGridExWidget v1.7.0","permalink":"/BBjGridExWidget/blog/gx-grid-v1.7.0"}},"content":"### Bug Fixes\\n\\n* :bug: `GxClientTransactionModel` should use LinkedHashSet to maintain order ([50e557e](https://github.com/BBj-Plugins/BBjGridExWidget/commit/50e557ed13ae7267f4d1147ef4d76e22a8385d65))\\n* **js:** :bug: `gw_setSortModel` does not merge previous state correctly ([fc68973](https://github.com/BBj-Plugins/BBjGridExWidget/commit/fc68973f651e10cf20cce1b2d343d7ff72ccb9d9))\\n* **js:** :bug: `gw_setSortModel` should not apply the order be default ([489b72d](https://github.com/BBj-Plugins/BBjGridExWidget/commit/489b72dc8f37fbe10be2a6e3292cf5fbe4679d34))"},{"id":"gx-grid-v1.7.0","metadata":{"permalink":"/BBjGridExWidget/blog/gx-grid-v1.7.0","editUrl":"https://github.com/BBj-Plugins/BBjGridExWidget/tree/dev/website/blog/2022-04-12-gx-grid-v1.7.0/index.md","source":"@site/blog/2022-04-12-gx-grid-v1.7.0/index.md","title":"BBjGridExWidget v1.7.0","description":"BBjGridExWidget v1.7.0 has been released. The following is the changelog list:","date":"2022-04-12T00:00:00.000Z","formattedDate":"April 12, 2022","tags":[{"label":"release","permalink":"/BBjGridExWidget/blog/tags/release"},{"label":"changelog","permalink":"/BBjGridExWidget/blog/tags/changelog"}],"readingTime":1.33,"hasTruncateMarker":false,"authors":[{"name":"Hyyan Abo Fakher","title":"Maintainer","url":"https://github.com/hyyan","imageURL":"https://github.com/hyyan.png","key":"hyyan"}],"frontMatter":{"slug":"gx-grid-v1.7.0","title":"BBjGridExWidget v1.7.0","authors":["hyyan"],"tags":["release","changelog"]},"prevItem":{"title":"BBjGridExWidget v1.7.1","permalink":"/BBjGridExWidget/blog/gx-grid-v1.7.1"}},"content":"BBjGridExWidget v1.7.0 has been released. The following is the changelog list:\\n\\n## Bug Fixes\\n\\n* **Demo:** RowGrouping demo is broken in ag-grid 27 ([d8c8988](https://github.com/BBj-Plugins/BBjGridExWidget/commit/d8c89883047613196a3b7f10a238cc87ef131a73))\\n* GxOptions should not set locale text if text is empty ([2c62a3b](https://github.com/BBj-Plugins/BBjGridExWidget/commit/2c62a3b82b14fc9128b75bca61cd5cbcb384f416))\\n* keyboard navigation is broken in ag-grid v27 ([8d54900](https://github.com/BBj-Plugins/BBjGridExWidget/commit/8d549009a8ded3447b4aa91fd99385a9137ea137))\\n* replace `GxOptions.RowDeselection` with `GxOptions.SuppressRowDeselection` ([75d243a](https://github.com/BBj-Plugins/BBjGridExWidget/commit/75d243ab078f04b7664c802dae4ebcb71474cdf8))\\n* Tooltips fails to render in ag-grid 27 ([6704657](https://github.com/BBj-Plugins/BBjGridExWidget/commit/6704657560ba730da4f2b6c1475e18791125abe1))\\n\\n\\n## Code Refactoring\\n\\n* `GxOptions.EnableFloatingFilter` won\'t have an effect anymore. it is deprecated([68caf8f](https://github.com/BBj-Plugins/BBjGridExWidget/commit/68caf8facebacdbe735ebebc85af41b60e31b00c))\\n* `GxOptions.setImmutableColumns` is deprecated ([96b9d07](https://github.com/BBj-Plugins/BBjGridExWidget/commit/96b9d070280bb9c4b5155d41faf8b7823f155b3d))\\n* `GxState.getString` does not contain the sort array anymore ([7c35c1d](https://github.com/BBj-Plugins/BBjGridExWidget/commit/7c35c1d33352304ef25a7a570ae93d145ecfe1da))\\n* deprecate `GxOptions.GroupSuppressRow`. ([7960b54](https://github.com/BBj-Plugins/BBjGridExWidget/commit/7960b541675f07bab2f4f9c6435d928ec3ea2e8b))\\n* deprecate `PinnedRowCellRendere` ([e43a43a](https://github.com/BBj-Plugins/BBjGridExWidget/commit/e43a43ad4d076c040f3a734d3deb901b69460c4c))\\n\\n\\n## Features\\n\\n* add `GxOptions.ColumnHoverHighlight` ([40c49a5](https://github.com/BBj-Plugins/BBjGridExWidget/commit/40c49a527572f5fe5700dd65bea054c760b66fab))\\n* add `GxOptions.GroupDisplayType` ([d3f65ca](https://github.com/BBj-Plugins/BBjGridExWidget/commit/d3f65cac7213cac085d1e65ce8b3290292ed44b2))\\n* update LicenseManager to v27 ([4090e06](https://github.com/BBj-Plugins/BBjGridExWidget/commit/4090e060ef9018f2d761ea41bf83307fdbdc7647))\\n\\n\\n## refactore\\n\\n* `GxFilterSetFilter.NewRowsAction` &\\n`GxFilterSetFilter.SuppressRemoveEntries` have no affect at all. They\\nare deprecated. ([21700b5](https://github.com/BBj-Plugins/BBjGridExWidget/commit/21700b500313e895df505c913c814a1ac4cfdcc1))\\n* `GxFilterSetFilter.suppressSyncValuesAfterDataChange` is deprecated ([9b3eae9](https://github.com/BBj-Plugins/BBjGridExWidget/commit/9b3eae92dbd3007b69f19379bb2d0a5b90418b2a))\\n\\n\\n## BREAKING CHANGES\\n\\n* `GxFilterSetFilter.NewRowsAction` &\\n`GxFilterSetFilter.SuppressRemoveEntries` have no affect at all. They\\nare deprecated with no replacemnets\\n* `GxFilterSetFilter.suppressSyncValuesAfterDataChange`\\nhas been been deprecated. This option has no replacement\\n* `GxOptions.EnableFloatingFilter` won\'t have effect\\nanymore. it is deprecated. You can enable/disable the floating filter per\\ncolumn.\\n* Setting the `PinnedRowCellRendere` won\'t affect the rendering anymore. Use the `CellRenderer` instead\\n* `GxOptions.GroupMultiAutoColumn`,\\n`GxOptions.GroupUseEntireRow` , `GxOptions.GroupSuppressAutoColumn` are\\ndeprecated. Use `GxOptions.GroupDisplyType` instead\\n* deprecate `GxOptions.GroupSuppressRow`. There is no\\nreplacement for this functionality.\\n* rowDeselection no longer has any affect as the grid now\\nallows row deselection by default. To block row deselection set\\nsuppressRowDeselection to true.\\n* `GxState.getString` does not contain the sort array\\nanymore. The sort state is contained in the columns array now.\\n* Grid Option \'immutableColumns\' is now gone. Columns\\nare immutable by default."}]}')}}]);